/** @type {import('express').Handler} */
export default async (req, res) => {
  const internalFiles = {
    pdf: {
      fileMimeType: 'application/pdf',
      fileContent:
        '',
    },
    jpg: {
      fileMimeType: 'image/jpeg',
      fileContent:
        '',
    },
    jpeg: {
      fileMimeType: 'image/jpeg',
      fileContent:
        '',
    },
    png: {
      fileMimeType: 'image/png',
      fileContent:
        '',
    },
    gif: {
      fileMimeType: 'image/gif',
      fileContent:
        '',
    },
    svg: {
      fileMimeType: 'image/svg+xml',
      fileContent:
        '',
    },
  };

  const externalFiles = {
    pdf: 'https://d9yw7530xbzu.cloudfront.net/assets/V15DetectUserManual.pdf',
    jpg: 'https://placehold.co/200x200/jpg',
    jpeg: 'https://placehold.co/300x300/jpg',
    png: 'https://placehold.co/400x400/png',
    svg: 'https://placehold.co/500x500/',
    gif: 'https://media1.tenor.com/m/1f5_2MkOz8cAAAAd/8bit-dance.gif',
  };

  const fileType = req.body.backendEventData?.fileType;

  if (req.body.backendEventData?.type === 'internal') {
    res.send({
      filename: `Internal-${fileType}-Test`,
      fileExtension: fileType,
      fileMimeType: internalFiles[fileType].fileMimeType,
      fileContent: internalFiles[fileType].fileContent,
    });

    return;
  }

  if (req.body.backendEventData?.type === 'external') {
    res.send({
      filename: `External-${fileType}-Test`,
      fileExtension: fileType,
      fileContentUrl: externalFiles[fileType],
    });

    return;
  }

  if (req.body.backendEventData?.type === 'internal-empty-file-content') {
    res.send({
      filename: 'test',
      fileExtension: 'png',
      fileMimeType: 'image/png',
    });

    return;
  }

  if (req.body.backendEventData?.type === 'external-wrong-url') {
    res.send({
      filename: 'test',
      fileExtension: 'pdf',
      fileContentUrl: 'https://d9yw7530xbzu.cloudfront.net/assets/V15DetectUserManual.pdf',
    });

    return;
  }

  if (!fileType || (!internalFiles[fileType] && !externalFiles[fileType])) {
    res.status(400).send({ error: 'Unsupported file type' });

    return;
  }

  res.status(400).send({ error: 'Invalid request' });
};
